import "./App.scss";

const numberOfLines = 5;
const numberOfColumns = 5;

const matrix = Array.from({ length: numberOfLines }, () =>
  Array.from({ length: numberOfColumns }, () => ({
    id: Math.random() * 100,
    value: Math.floor(Math.random() * 100),
  }))
);

console.log(matrix);

function App() {
  return <div className="App">Hello</div>;
}

export default App;
